import React from 'react'

const Hero = () => {
  return (
    <div name='home' className='flex flex-col justify-between w-full h-screen bg-gray-900 text-white text-center md:text-left'>
        <div className='grid md:grid-cols-2 max-w-screen-xl m-auto px-3'>
            <div className='flex flex-col justify-center md:items-start w-full px-12 py-8'>
              <p className='text-2xl text-gray-500'>Worlds Cheapest Hosting</p>
            </div>
        </div>

    </div>
  )
}

export default Hero
